// src/About.js
import React from 'react';

function About() {
  return (
    <div style={{ padding: "2rem" }}>
      <h2>About This Application</h2>
      <p>This is a simple video recording application built with React and a Python backend.</p>
      <p>It allows users to start and stop video recordings, organize them by session, and view recorded videos.</p>
    </div>
  );
}

export default About;
